import './index.css';
import { useNavigate } from 'react-router-dom';

const Navigation = () => {
    let navigate = useNavigate();
    const bla = (id) => {
        navigate(`${id}`);
    }
    
    return(
        <>
            <header>
                <nav>
                    <img className='logo-img' src='/navigation-images/logo.png' alt='Site Logo' onClick={bla}></img>
                    <div className='create-button'>
                        <button onClick={bla}>
                            <div>
                                <img src='/navigation-images/user-profile-icon.png' alt='User Icon'></img>
                                <p>Fazer Login</p>
                            </div>
                        </button>
                        <button>
                            <div>
                                <img src='/navigation-images/user-profile-icon.png' alt='User Icon'></img>
                                <p>Criar Conta</p>
                            </div>
                        </button>
                    </div>
                </nav>
            </header>
        </>
    )
}

export default Navigation;
